func TestInsertTransaction(t *testing.T) {
	os.Setenv("DB", "mysql")
	os.Setenv("DBURL", "root:root@tcp(127.0.0.1:3306)/kredit_plus")
	db := &mock.MockDB{}
	repo := repository.NewKonsumenRepository()
	// Prepare the mock statement
	mockStmt := &sql.Stmt{}
	db.MockPrepare = func(stmt *sql.Stmt, err error) {
		mockStmt = stmt
	}
	fmt.Println(mockStmt)

	// Mock the Exec method to return a success result
	result := &mock.MockResult{RowsAffecteds: 1}
	db.MockExec = func(res sql.Result, err error) {
		res = result
	}
	random, _ := helpers.GenerateRandomNumber(7)
	stRand := strconv.Itoa(random)
	request := &request.InsertTransactionRequest{
		NomorKontrak:  stRand,
		Otr:           100000000,
		AdminFee:      5000000,
		JumlahCicilan: 10,
		JumlahBunga:   "5000000",
		NamaAsset:     "Mobil",
		Nik:           "1234567890",
	}

	err := repo.InsertTransaction(request)

	assert.NoError(t, err)

}

